import React, {useState} from 'react';

export default function Form() {
	const [title,setTitle] = useState('');

	const handleOnChange = (e) => {
		setTitle(e.target.value);
	}

	return (
		<div>
			<input type="text" onChange={handleOnChange}/>
			<button>Add Location</button>
		</div>
	);
}
